import React from "react";

const TempWorkshopInfo = ({ tempWorkshop }) => {
  return console.log(tempWorkshop);
  /* {<li>
      <div>{tempWorkshop.data.date}</div>
      <div>{tempWorkshop.data.title}</div>
      <div>{tempWorkshop.data.speaker}</div>
      <div>{tempWorkshop.data.room}</div>
      <div>{tempWorkshop.data.roomManager}</div>
      <div>{tempWorkshop.data.description}</div>
      <div>{tempWorkshop.data.roomType}</div>
      <div>{tempWorkshop.data.capacity}</div>
      <div>{tempWorkshop.data.status}</div>
    </li> */
};

export default TempWorkshopInfo;
